import React from "react";
import ShoppingBagIcon from "@mui/icons-material/ShoppingBag";
import FavoriteIcon from "@mui/icons-material/Favorite";
import HomeIcon from "@mui/icons-material/Home";
import AccountBalanceWalletIcon from "@mui/icons-material/AccountBalanceWallet";
import NotificationsIcon from "@mui/icons-material/Notifications";
import EventIcon from "@mui/icons-material/Event";
import LogoutIcon from "@mui/icons-material/Logout";
import { Drawer, useMediaQuery } from "@mui/material";
import zIndex from "@mui/material/styles/zIndex";

const Menu = [
  { title: "Order", icon: <ShoppingBagIcon /> },
  { title: "Favorites", icon: <FavoriteIcon /> },
  { title: "Address", icon: <HomeIcon /> },
  { title: "Notifaction", icon: <NotificationsIcon /> },
  { title: "Event", icon: <EventIcon /> },
  { title: "Payment", icon: <AccountBalanceWalletIcon /> },
  { title: "LogOut", icon: <LogoutIcon /> },
];
export const ProfileNavigation = ({ open, handleClose }) => {
  const isSmallScreen = useMediaQuery("max-width:1080");

  return (
    <div>
      <Drawer
        sx={{ zIndex: 1 }}
        anchor="left"
        open={open}
        variant={isSmallScreen ? "temporary" : "permanent"}
      >
        <div className="w-[50vw] lg:w-[20vw] h-[100vh] flex flex-col justify-normal"></div>
      </Drawer>
    </div>
  );
};
